(1,	2,	1,	'Get Facebook feeds from an authenticated user',	'Get Facebook feeds from an authenticated user',	NULL,	NULL,	1,	NULL,	2,	NULL,	1,	0,	'2012-08-13 19:44:29',	'2012-08-13 19:44:29',	'2012-08-13',	0,	2,	NULL,	1,	1,	2,	0),
(2,	2,	1,	'Get Tweets from authenticated user twitter account',	'Get Tweets from authenticated user twitter account',	NULL,	NULL,	1,	NULL,	2,	NULL,	1,	0,	'2012-08-13 19:53:20',	'2012-08-13 19:53:20',	'2012-08-13',	0,	2,	NULL,	2,	1,	2,	0),
(14,	4,	11,	'R12/296/130 - USA - Avi - Nelson Brown- Omni Business Solutions',	'http://www.usac.org/_res/documents/about/pdf/rfp/RFP-NLAD.pdf',	NULL,	NULL,	1,	NULL,	2,	NULL,	1,	0,	'2012-08-17 15:42:56',	'2012-08-17 15:42:56',	'2012-08-17',	0,	NULL,	NULL,	14,	1,	2,	0),
(15,	4,	11,	'R12/283/117 - M.E - Naren - Henri Odero- Irshadat - Website Development - ASP.Net',	'Dear Sen,\r\n\r\nPlease send us a quote for the creation of website similar to this: www.laredoute.com\r\n\r\nRegards,\r\n\r\nHenri Odero\r\n',	NULL,	NULL,	5,	22,	2,	NULL,	22,	2,	'2012-08-17 15:45:51',	'2012-08-17 16:13:09',	NULL,	100,	8,	NULL,	15,	1,	2,	0),
(26,	1,	7,	'Word \"Meeting \" and \"Registration\" Mis-spelled',	'The word “meeting” is mis-spelled as “metting” in the field label in the “create/update listing” page. The word “registration” is mis-spelled as “Registeration” in the heading of the page obtained on clicking the any icon under the heading “registration” in the admin login page.',	NULL,	2,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-10 16:06:21',	'2012-11-23 10:39:07',	'2012-09-10',	0,	NULL,	NULL,	26,	1,	2,	0),
(32,	1,	7,	'Incorrect Error Message',	'Note: The error message displayed in the registration page on hitting the register button without filling any fields is incorrect is reads as “You Entered Text Doesn\'t Match it should read as “Your Entered Text Doesn\'t Match”.',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-10 17:27:00',	'2012-11-23 10:30:20',	'2012-09-10',	0,	NULL,	NULL,	32,	1,	2,	0),
(34,	2,	7,	'Upper/Lower Case Letter',	'The logout link in the home page should start with an upper case letter as “Logout” instead of reading as “logout”. Give the letter “I” in small case letter in the label “LogIn” and “RegIster” to read as “Login”  “Register” inside the Button.',	NULL,	2,	5,	24,	2,	NULL,	21,	2,	'2012-09-11 12:05:15',	'2012-11-23 10:34:08',	'2012-09-11',	100,	NULL,	NULL,	34,	1,	2,	0),
(35,	1,	12,	'Navigation button  - banner',	'The No.of navigation button in the home page banner(4)differs from the No.of banner displayed in the home(2).',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-18 14:28:16',	'2012-11-01 14:51:43',	'2012-09-18',	0,	NULL,	NULL,	35,	1,	2,	0),
(36,	1,	12,	'Alert Message populated for non mandatory fields.',	'The “Authorized to enter Canada” and the “Date of Birth” fields are not marked as mandatory but an alert message “Please select an option” and “This field is required” is populated for the respective field in the “Hercules Freight Forwarding Online Job Application” page obtained on clicking – online driver application tab under the main tab company information. \r\n\r\nThe “contact name” field in the “request a pickup” page, is not marked as mandatory but a alert message is populated for the concern field.',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-18 14:35:31',	'2012-10-05 10:34:55',	'2012-09-18',	0,	NULL,	NULL,	36,	1,	2,	0),
(37,	1,	12,	'Default Inline label missing',	'Give a default label “Select a state or province” and “select a shipment” for the “state/province” and “total shipment” field respectively in the “request a pickup” page and validate the same in all the pages. ',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-18 14:44:11',	'2012-10-16 10:02:03',	'2012-09-18',	100,	NULL,	NULL,	37,	1,	2,	0),
(38,	1,	12,	'Not validating Phone number',	'It’s not validating the optional “phone number” field in the “Request a pickup” page under the pickup info section.',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	4,	'2012-09-18 15:07:26',	'2012-10-08 10:37:58',	'2012-09-18',	100,	NULL,	NULL,	38,	1,	2,	0),
(39,	1,	12,	'Entered details vanishes - Request a pickup page.',	'On entering all the details under the delivery info in the “Request a Pickup” page and changing the number of shipments in the \"total shipment” field the previously entered details under delivery info vanishes.',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-18 15:46:31',	'2012-10-08 11:25:53',	'2012-09-18',	100,	NULL,	NULL,	39,	1,	2,	0),
(40,	1,	12,	'Alert Message not populated ',	'On submitting the page with the total shipments option more than 1, in \"request a pickup\" page the alert message populates only for the last set of delivery info. On clicking the submit button after entering all the mandatory field with the alert message excluding the mandatory fields without alert message it  populates alert for the fields without alert message and it vanishes immediately.',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-18 16:00:00',	'2012-10-16 10:10:27',	'2012-09-18',	0,	NULL,	NULL,	40,	1,	2,	0),
(41,	1,	12,	'Error Message Displayed Twice',	'Both The error message and the alert message is displayed for the same fields in the \"Hercules Registration\" page.',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-18 17:06:12',	'2012-11-02 15:13:08',	'2012-09-18',	0,	NULL,	NULL,	41,	1,	2,	0),
(42,	1,	12,	'Incorrect label',	'In “Request a pickup” page the fields are available for both “State/Province” and “Zip/postal” whereas in the “online bill of lading and Request For information page” under the document and company information tab, the fields labels are given only for “Zip” and “State” change the label to serve for both US and Canada. Note : The state drop down field contains canadian provinces.',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-18 17:22:38',	'2012-10-16 10:13:09',	'2012-09-18',	100,	NULL,	NULL,	42,	1,	2,	0),
(43,	1,	12,	'Incorrect headings',	'In the “Terminal listing” page under the title Canada change the heading “zip” to read as “Postal” and for USA change the heading “Province” to “State”.',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-18 17:33:57',	'2012-10-05 12:10:53',	'2012-09-18',	100,	NULL,	NULL,	43,	1,	2,	0),
(44,	1,	12,	'Tab alignment not proper.',	'The tab alignment is not proper in all the pages it is skipping the “State/Province” field. ',	NULL,	NULL,	1,	NULL,	2,	NULL,	21,	0,	'2012-09-20 13:36:20',	'2012-09-20 13:36:20',	'2012-09-20',	0,	NULL,	NULL,	44,	1,	2,	0),
(45,	1,	12,	'Char Limitation  - ZIP/Postal code field',	'On selecting a state from the drop down box the zip/postal code field should accept a maximum of only 5 char if a province is selected from the drop down box then it should accept a minimum of 6 char in other cases it should populate an alert message.',	NULL,	NULL,	1,	NULL,	2,	NULL,	21,	0,	'2012-09-20 14:28:31',	'2012-09-20 14:28:31',	'2012-09-20',	0,	NULL,	NULL,	45,	1,	2,	0),
(46,	1,	12,	'Links in the footer not working.',	'The terms and privacy policy link in the home page footer are not directing anywhere.',	NULL,	NULL,	4,	NULL,	2,	NULL,	21,	1,	'2012-09-20 14:44:04',	'2012-11-01 13:42:26',	'2012-09-20',	0,	NULL,	NULL,	46,	1,	2,	0),
(47,	1,	12,	'Amount field validation',	'The COD Amount field in the document page under the section “Items no” accepts alphabets. Since it’s an amount field it should accept only numeric in case of alpha entry or alpha numeric entry it should populate an alert message.\r\n\r\n',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-20 14:49:37',	'2012-10-08 11:44:47',	'2012-09-20',	100,	NULL,	NULL,	47,	1,	2,	0),
(48,	1,	12,	'Submit button inline label differs',	'Note: In the user registration page at the bottom it is given as “If you don\'t know your account ID or PRO numbers, just click \"submit registration\". But the label for the button is just given as “Submit” instead of \"submit registration\".',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	3,	'2012-09-20 15:00:21',	'2012-11-02 15:15:53',	'2012-09-20',	0,	NULL,	NULL,	48,	1,	2,	0),
(49,	1,	12,	'Alignment issue',	'Note: The alignment of the word “zip” in the heading is not properly aligned under USA in the Terminal Listing page.',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-20 15:09:19',	'2012-10-05 12:17:50',	'2012-09-20',	100,	NULL,	NULL,	49,	1,	2,	0),
