(51,	1,	12,	'Navigation button not visible in date picker.',	'The naviation button is not visible in the date picker given for the \"pickup date\" field in the \"Request a pickup\" page.\r\nNote: The future date should be blurred in the date pickers for date of birth fields I.e the date following the current date should be blurred or it should populate an alert message on picking a future date for date of birth.',	NULL,	NULL,	5,	NULL,	2,	NULL,	21,	2,	'2012-09-20 15:54:22',	'2012-10-22 12:55:33',	'2012-09-20',	100,	NULL,	NULL,	51,	1,	2,	0),
