(851,	1,	26,	'V.1.7. Provide space between - List count and Listings found text in Search Option',	'Description\r\n\r\nSteps to Reproduce\r\n\r\n1. Enter the URL - Listings.does-it.net/home.aspx\r\n\r\n2. Enter the Valid keyword search in any one of the search.\r\n\r\n3. We will get the Search Result as below\r\n\r\n27Listings found\r\n\r\n4.Here there is no space between list quantity number and text Listings found\r\n\r\n\r\n\r\nActual Result\r\n\r\nThe search result shows result with counts for number of Listings found with no space between count number and Listings found text.\r\n\r\nExpected Result\r\n\r\nSpace needed between count number and \"Listings found\" text.',	NULL,	NULL,	5,	NULL,	2,	NULL,	60,	2,	'2013-02-27 19:07:32',	'2013-03-06 15:46:07',	'2013-02-27',	0,	NULL,	NULL,	851,	1,	2,	0),
