(853,	1,	9,	'Ver 0.6.0: Send for Approval Button Overlaps with the text in Mozilla',	'Steps to Reproduce:\r\n\r\n1. Go to (http://192.168.6.27:60497/corpportal).\r\n2. Login with the admin credentials.\r\n3. Go to User Role\r\n4. Select the \"My Appraisals\" tab from the left side panel.\r\n5. Click Appraisal, and click the symbol + to add a new appraisal.\r\n6. Enter all the fields with valid data \r\n7. Click the submit button. \r\n8. In the Grid, new saved appraisal title click the \"Fill Appraisal\" and enter all the details required in the fill appraisal form. \r\n9. Click the Save option.  \r\n10. Get back to Click the My Appraisals->Appraisal\r\n\r\nActual Result: \r\n\r\n1. \"Send for Approval\" button moves up near the \"Edit Appraisal\"(Mozilla 10.0)\r\n\r\nExpected Result: \r\n\r\n1. Move the Send For Approval Button in the next line of Edit Appraisal. ',	NULL,	NULL,	4,	NULL,	2,	NULL,	58,	5,	'2013-02-28 11:46:31',	'2013-03-14 16:31:44',	'2013-02-28',	0,	NULL,	NULL,	853,	1,	2,	0),
(854,	1,	9,	'Ver 0.6.0: Reset Button is not working fine in Fill Appraisal ',	'Steps to Reproduce:\r\n\r\n1. Go to (http://192.168.6.27:60497/corpportal).\r\n2. Login with the admin credentials.\r\n3. Go to User Role\r\n4. Select the \"My Appraisals\" tab from the left side panel.\r\n5. Click Appraisal, and click the symbol + to add a new appraisal.\r\n6. Enter all the fields with valid data.\r\n7. Click the submit button. \r\n8. In the Grid, new saved appraisal title click the \"Fill Appraisal\" and enter all the details required in the fill appraisal form.  \r\n9. In the PROFESSIONAL CHARACTERISTICS/COMPETENCIES/ACCOMPLISHMENTS/Review of Pre-established Goals give the \"Self rating\"\r\n   and Enter the comments in the text box.\r\n10. Click the Reset Button \r\n\r\nActual Result: \r\n\r\n1. The given comment in the text box stays stable in the field, dint get vanish.\r\n\r\nExpected Result: \r\n\r\n1. The comments given in the text should get vanish. Reset button is not working its functionality. \r\n',	NULL,	NULL,	5,	NULL,	2,	NULL,	58,	5,	'2013-02-28 11:48:04',	'2013-03-12 15:26:49',	'2013-02-28',	0,	NULL,	NULL,	854,	1,	2,	0),
