(913,	1,	7,	'V-1.8 :  Manage Template Property not get added without selecting the Data Type',	'Steps to Reproduce\r\n\r\n1. Enter the URL - Listings.does-it.net/home.aspx\r\n\r\n2. Log on to the Admin section.\r\n\r\n3. Click on Manage Template Property\r\n\r\n4. Select the template name,prioperty name and Display name.\r\n\r\n5. Click on submit button without selecting the Data Type\r\n\r\n6. The Template Property is not added and no error message is displayed for not entering the Data Type.\r\n\r\n\r\nActual Result\r\n\r\nThe Template Property is added with the selection of data type. Without the selection of the data type should throw the error message.\r\n\r\nExpected Result\r\n\r\nThe Template Property is not added and no error message is displayed for not entering the Data Type.\r\n\r\nPlease find the attached screenshot for your reference.',	'2013-03-06',	6,	5,	49,	5,	NULL,	60,	2,	'2013-03-06 19:38:13',	'2013-03-07 11:51:29',	'2013-03-06',	0,	NULL,	NULL,	913,	1,	2,	0),
