(915,	1,	7,	'V-1.8 :  Favourite and Review not deleted for a Scenario when a record is deleted in Admin ',	'Steps to Reproduce:\r\n\r\n1. Enter the URL - Listings.does-it.net/home.aspx in three browsers\r\n\r\n2. Login using different users say User1 and User2 and Admin\r\n\r\n3. Post a list on User1 say \"Watches\"\r\n\r\n4. Now Search keyword \"Watches\" from User2 and add it as favorites and also post the reviews for the Watches.\r\n\r\n5. Now  Login Admin and delete the list named Watches in the Manage Listings.\r\n\r\n6. When the User2 refresh his account, his favorite is not deleted and the grid is displayed with $.\r\n\r\n7.The The reviews added for the favourite also not deleted.\r\n\r\nActual Result\r\n\r\nOnce the record from Admin is deleted, corresponding Favourite and reviews are not deleted.\r\n\r\nExpected Result\r\n\r\nOnce the record from Admin is deleted, corresponding Favourite and reviews to be deleted.\r\n\r\nPlease find the attached screenshot for your reference.\r\n',	NULL,	6,	5,	38,	5,	NULL,	60,	2,	'2013-03-06 20:38:55',	'2013-03-07 12:08:06',	'2013-03-06',	0,	NULL,	NULL,	915,	1,	2,	0),
(916,	1,	7,	'V-1.9 :  User is being Active in his account until he logout for a particular scenario when the user is made inactive in Admin',	'Steps to Reproduce:\r\n\r\n1. Enter the URL - Listings.does-it.net/home.aspx \r\n\r\n2. Login using different user say User1 \r\n\r\n3. We login Admin and in another system\r\n\r\n4. Make the User1 as inactive.\r\n\r\n5. The user1 is active for long time until he logout from his login.\r\n\r\n\r\n\r\nActual Result\r\n\r\nWhen the User1 is Logon  and work on it ,the particular User is made Inactive by Admin, the User1 is able to be in his same login until he log out from his account.\r\n\r\nExpected Result\r\n\r\nWhen the User1 is Logon  and work on it ,the particular User is made Inactive by Admin, at once the user should be logged out from his login.\r\n\r\nNote:\r\n\r\nWe experienced this issue with different machines.\r\n\r\n',	'2013-03-11',	NULL,	5,	49,	5,	NULL,	60,	2,	'2013-03-07 12:46:23',	'2013-03-15 19:42:56',	'2013-03-07',	0,	NULL,	NULL,	916,	1,	2,	0),
