(1069,	1,	7,	'V.1.10 The Social Group Drop down is not restricted to a Standard Size with a Vertical Scroll bar on the RHS.',	'\r\nSteps to Reproduce\r\n\r\n1. Enter the URL -  Listings.does-it.net/home.aspx\r\n\r\n2. Login to the application\r\n\r\n3. While Add a Listing - Click on the Social group drop down\r\n\r\nObserve the DD displayed - When there is a Big List of Options\r\n\r\n\r\n\r\nActual Result\r\n\r\nDrop down is not restricted to a Standard Size with a Vertical Scroll bar on the RHS.\r\n\r\n\r\nExpected  Result \r\n\r\nDrop down Should be restricted to a Standard Size with a Vertical Scroll bar on the RHS.\r\n\r\nRef Screen shot',	'2013-03-18',	6,	1,	49,	3,	NULL,	54,	1,	'2013-03-18 18:25:41',	'2013-03-18 22:11:09',	'2013-03-18',	0,	NULL,	NULL,	1069,	1,	2,	0),
(1070,	1,	7,	'V- 1.10: template screen details didnt displayed in front end',	'steps to reproduce:\r\n\r\n1. Go to http://listings.does-it.net/home.aspx\r\n2. login with admin credentils\r\n3. click manage categories\r\n4. add one category(eg:Electronics)\r\n5. click manage sub category\r\n6. add sub category to category \"Electronics\"(Eg: Washing Machine)\r\n7. now click manage template and add template for \"Electronics\"(eg: Brand)\r\n8. Assign template property values for Brand and logout from the apps\r\n9. now login with user credentials\r\n10. click post your listings link\r\n11. go to category and select \"electronics\" in dropdown\r\n12. observe the response\r\n\r\nActual Result: the added template values did not displayed \r\n\r\nExpected Result: the added template values should be display in front end',	'2013-03-18',	NULL,	1,	49,	3,	NULL,	52,	1,	'2013-03-18 18:33:27',	'2013-03-18 20:10:56',	'2013-03-18',	0,	NULL,	NULL,	1070,	1,	2,	0),
(1071,	2,	7,	'V- 1.10: price details not displayed with full format in preview page(XXX.xx)',	'steps to reproduce:\r\n\r\n1. Go to http://listings.does-it.net/home.aspx\r\n2. now login with user credentials\r\n3. click post your listings link\r\n4. enter values for all * fields\r\n5. click preview button\r\n6. observe the price value format\r\n\r\nActual Result: the price value not displayed with full format like view full listing page details\r\n\r\nExpected Result: the price value should be display with full format(XXX.XX)like view full listing page details',	'2013-03-18',	NULL,	1,	49,	2,	NULL,	52,	2,	'2013-03-18 19:37:57',	'2013-03-18 21:06:56',	'2013-03-18',	0,	NULL,	NULL,	1071,	1,	2,	0),
(1072,	1,	9,	'Ver 0.9.0 - Branch Admin role map to himself',	'Steps to Reproduce:\r\n1. Go to Tag Website\r\n2. Login as branch admin and Click on Employee and Role Map Master\r\n3. Click on Add to add new recording the Employee and Role Map Master, the drop-down displays the User Name who is the branch admin.\r\n\r\nActual Result: \r\n\r\nThe drop-down in adding the Employee and Role Map Master displays branch admin name\r\n\r\nExpected Result: \r\n\r\nThe drop-down in adding the Employee and Role Map Master should display only associated branch names other than branch admin. ',	NULL,	NULL,	3,	NULL,	4,	NULL,	60,	1,	'2013-03-18 19:41:50',	'2013-03-19 15:16:45',	'2013-03-18',	0,	NULL,	NULL,	1072,	1,	2,	0),
(1073,	1,	7,	'V.1.10 In admin - The User is not able to Change Password ',	'Steps to Reproduce\r\n\r\n1. Enter the URL - Listings.does-it.net/home.aspx\r\n\r\n2. Login to the application as admin\r\n\r\n3. Try to Change Password\r\n\r\n\r\nActual Result\r\n\r\nPassword Change not happening - The user Confronts the message Invalid - Old Password\r\n\r\nExpected Result\r\n\r\nPass word should be changeable.\r\n\r\n',	'2013-03-18',	NULL,	1,	49,	4,	NULL,	54,	1,	'2013-03-18 19:44:26',	'2013-03-18 20:36:43',	'2013-03-18',	0,	NULL,	NULL,	1073,	1,	2,	0),
(1074,	1,	9,	'Ver 0.9.0 - Branch Admin role map to himself',	'Steps to Reproduce:\r\n1. Go to Tag Website\r\n2. Login as branch admin and Click on Employee and Role Map Master\r\n3. In branch admin, all the employees are displayed with edit and delete optons.\r\n\r\nActual Result: \r\n\r\nThe branch admin displays the all the Employees with in Employee Role Map Master\r\n\r\nExpected Result: \r\n\r\nThe branch admin should display the location wise Employee in Role Map Master',	NULL,	NULL,	3,	NULL,	4,	NULL,	60,	2,	'2013-03-18 20:09:32',	'2013-03-19 15:11:52',	'2013-03-18',	0,	NULL,	NULL,	1074,	1,	2,	0),
(1075,	1,	9,	'Ver 0.9.0 - Branch Admin is able to report to himself by editing his profile in Employee List',	'Steps to Reproduce:\r\n1. Go to Tag Website\r\n2. Login as branch admin and Click on List of Employees in employee maangement\r\n3. The employess associated with that branch and reporting to the branch admin are displayed.\r\n4. The branch admin profile is also able to view and editable.\r\n5. Here we are able to assign his name to report himself.\r\n\r\nActual Result: \r\n\r\nThe branch admin is be able to report himself\r\n\r\nExpected Result: \r\n\r\nThe branch admin should not be able to report to himself.\r\n',	NULL,	NULL,	3,	NULL,	4,	NULL,	60,	2,	'2013-03-18 20:17:47',	'2013-03-19 15:07:53',	'2013-03-18',	0,	NULL,	NULL,	1075,	1,	2,	0),
(1076,	1,	9,	'Ver 0.9.0 - Improper popup warning message',	'Steps to Reproduce:\r\n\r\n1. Go to Tag Website\r\n2. Login as branch admin and Click on EMPLOYEE AND ROLE MAP MASTER in Role management\r\n3. Select a record to delete and the message popup \"Successfully Deleted\" displays with warning message instead of pop up message.\r\n\r\n\r\nActual Result: The warning message shows \"Successfully Deleted\" after the record deleted \r\n\r\nExpected Result: The popup info message should show \"Successfully Deleted\" after the record deleted\r\n',	NULL,	NULL,	3,	NULL,	2,	NULL,	60,	1,	'2013-03-19 11:40:52',	'2013-03-19 14:48:55',	'2013-03-19',	0,	NULL,	NULL,	1076,	1,	2,	0),
(1077,	1,	9,	'Ver 0.9.0 - Able to fill Timesheet for future date',	'Steps to Reproduce:\r\n1. Go to Tag Website\r\n2. Login as user and fill time sheet greater than today selected from calender and it saves the timesheet.\r\n\r\n\r\n\r\nActual Result: The timesheet accepts future dates to fill and save.\r\n\r\nExpected Result: The timesheet should accept only current date or less than current date and not future date to apply for timesheet.\r\n\r\nFind the screenshot attached.',	NULL,	NULL,	3,	NULL,	3,	NULL,	60,	1,	'2013-03-19 12:35:40',	'2013-03-19 14:31:47',	'2013-03-19',	0,	NULL,	NULL,	1077,	1,	2,	0),
