(1080,	1,	7,	'V.1.10 Back to Listings << takes user to Home Page.',	'Steps to Reproduce\r\n\r\n1. Enter the URL - Listings.does-it.net/home.aspx\r\n\r\n2. Login to the application with a BA/VA\r\n\r\n3. Click on the Welcome Username and Select a Listing from My Listings in Dashboard\r\n\r\n4. View Full listing \r\n\r\n5. Press the back arrow << Back to Listings\r\n\r\n\r\nActual Result\r\n\r\nReturned to HOME page\r\n\r\nExpected Result\r\n\r\nShould be returning to the Previous screen',	'2013-03-19',	6,	1,	49,	3,	NULL,	54,	1,	'2013-03-19 15:27:42',	'2013-03-19 16:40:36',	'2013-03-19',	0,	NULL,	NULL,	1080,	1,	2,	0),
