(1082,	2,	9,	'Ver 0.9.0: default value may convey wrong details for female candidate in personal info page',	'Steps to Reproduce:\r\n\r\n1. Go to http://192.168.6.27:60497/corpportal/auth/login\r\n2. login as super admin role\r\n3. click employee management tab--->employee master\r\n4. add new record in female name (eg: catherine)\r\n5. now click employee list option and observe the personal info page values for added record\r\n\r\nActual Result: for female candidate sex field value set as \"male\" by default\r\n\r\nExpected Result: set default value as \"select\" for sex and Marital status ',	NULL,	NULL,	3,	NULL,	2,	NULL,	52,	1,	'2013-03-19 16:22:00',	'2013-03-19 19:10:12',	'2013-03-19',	0,	NULL,	NULL,	1082,	1,	2,	0),
(1083,	1,	9,	'Ver 0.9.0: there is diff in field level validation for same fields in same page',	'1. Go to http://192.168.6.27:60497/corpportal/auth/login\r\n2. login as user role\r\n3. click edit profile option available at upper right corner\r\n4. click personal info option\r\n5. enter one digit value for \"Mobile Number\" and \"Phone\" fields and click update\r\n6. click reference details option\r\n7. try to add details with contact number(one digit)\r\n8. observe the pop up\r\n\r\nActual Result: Min boundary values not set for \"Mobile Number\" and \"Phone\" fields\r\n\r\n\r\nExpected Result: Min boundary values should be present for \"Mobile Number\" and \"Phone\" fields like \"Contact Number\"',	NULL,	NULL,	3,	NULL,	2,	NULL,	52,	1,	'2013-03-19 16:40:47',	'2013-03-19 21:00:56',	'2013-03-19',	0,	NULL,	NULL,	1083,	1,	2,	0),
(1084,	1,	9,	'Ver 0.9.0: contact number field in ref details screen not accepts 10-12 digit value',	'1. Go to http://192.168.6.27:60497/corpportal/auth/login\r\n2. login as user role\r\n3. click edit profile option available at upper right corner\r\n4. click reference details option\r\n7. try to add details with contact number(10-12 digit)\r\n8. observe the pop up\r\n\r\nActual Result: even for valid entry pop up displayed as \"contact number should not be less than 10 digits\"\r\n\r\nExpected Result: form should accept valid entry and save in the db\r\n\r\nNote: this issue exist while edit the record ',	NULL,	NULL,	3,	NULL,	2,	NULL,	52,	1,	'2013-03-19 16:55:52',	'2013-03-19 20:47:30',	'2013-03-19',	0,	NULL,	NULL,	1084,	1,	2,	0),
