(1086,	1,	9,	'Ver 0.9.0 - Java Script Error in IE',	'Steps to Reproduce:\r\n1. Go to Tag Website\r\n2. Login as user/Admin .\r\n3. We are getting the javascript error in status bar in IE\r\n\r\nMessage: Object doesn\'t support this property or method\r\n    Line: 427\r\n    Char: 2\r\n    Code: 0\r\n    URI: http://192.168.6.27:60497/corpportal/js/custom/general.js\r\n\r\n\r\n\r\nActual Result: We are getting java-script error in IE in XP machine\r\n\r\nExpected Result: We should not get any java script error in IE in XP machine\r\n\r\nFind the screen shot attached.',	NULL,	NULL,	1,	NULL,	3,	NULL,	60,	0,	'2013-03-19 18:24:55',	'2013-03-19 18:24:55',	'2013-03-19',	0,	NULL,	NULL,	1086,	1,	2,	0),
(1087,	1,	9,	'Ver 0.9.0 - Format displayed for Mins in the Grid as X instead of XX',	'Steps to Reproduce:\r\n1. Go to Tag Website\r\n2. Login as user/Admin.\r\n3. Click on the Time-sheet tab add new record with hours and without selecting the minutes.\r\n4. Then the Mins displayed in the grid as 0 instead of 00.\r\n\r\n\r\nActual Result: When the user not entered the Mins , then it is displaying as 0.\r\n\r\nExpected Result:  When the user not entered the Mins , then it should display as 00 instead of 0.\r\n\r\nFind the screen shot attached.',	NULL,	NULL,	1,	NULL,	2,	NULL,	60,	0,	'2013-03-20 13:13:09',	'2013-03-20 13:13:09',	'2013-03-20',	0,	NULL,	NULL,	1087,	1,	2,	0),
