(1090,	1,	7,	'V.1.10 Price displayed in two lines in Favorites.',	'Steps to Reproduce\r\n\r\n1. Enter the URL -  Listings.does-it.net/home.aspx\r\n\r\n2. Login to the application\r\n\r\n3. Click on Favourites \r\n\r\n4. Observe the display of a listing whose PRICE has Max digits.\r\n\r\n$ 100000000000.00\r\n\r\n\r\n\r\n\r\nActual Result\r\n\r\nPrice displayed in Two lines \r\n\r\n\r\n\r\nExpected  Result \r\n\r\nShould be displayed in one line.\r\n\r\n\r\nRef Screen shot',	NULL,	6,	1,	NULL,	3,	NULL,	54,	0,	'2013-03-20 15:00:59',	'2013-03-20 15:00:59',	'2013-03-20',	0,	NULL,	NULL,	1090,	1,	2,	0),
(1091,	1,	9,	'V.1.10 The listings of users who do not exist in DB are found to be in application.',	'Steps to Reproduce\r\n\r\n1. Enter the URL - Listings.does-it.net/home.aspx\r\n\r\n2. Login to the application\r\n\r\n3. Click on My listings\r\n\r\n4. Select a Listing and View details of Posted by and MID\r\n\r\n5. Check the Same User Name( Posted by) and MID in Admin - Basic/Verified Users screen\r\n\r\n         Enter User name/ID in Search fields and check whether they exist in DB.\r\n\r\n\r\nActual Result\r\n\r\nNo users are found by the name,but listing posted by them are still in the application displayed when searched for.\r\n\r\n\r\nExpected  Result \r\n\r\nWhen the users do not exist in DB, the listings posted by them also should not exist\r\n\r\n\r\nRef Screen shot',	NULL,	NULL,	1,	NULL,	3,	NULL,	54,	0,	'2013-03-20 17:47:18',	'2013-03-20 17:47:18',	'2013-03-20',	0,	NULL,	NULL,	1091,	1,	2,	0),
