(563,	243,	'Issue',	21,	'1. Highlight the error message in all possible places to match the old site eg:- highlight the error message in \"I\'ve Forgotten My Password!\" page. Leave proper spacing between the heading and the alert/error message.\r\n\r\n2. Change the error message “Your Shipping state should contain a minimum of 2 characters” to read as “Select a shipping state from the drop down list”.\r\n\r\nStep to reproduce:\r\n1. Go to \"My Account Information\" page\r\n2. Check and Uncheck the check box under \"Billing Address\"\r\n3. The default state \"Alabama\" in the drop down list under the shipping address details will vanish.\r\n4. Click the \"continue\" button.\r\n5. The error message will populate.',	'2013-01-03 13:17:07'),
