(1721,	633,	'Issue',	21,	'After the employee completes 1 year in the organisation then 6 days are credited to the 13th month.\r\n\r\nThe employee has an EL of 1 day per month only after he completes 1 year in the Organisation.\r\n\r\nThe no of available leave is empty for an employee with the status - permanent and has completed 2 yrs in the organisation. \r\n\r\nActual Result:\r\n1. On applying a leave (Type: CL/SL; EL)it populates a message as \"You doesn\'t have enough leaves\".\r\n\r\nExpected Result:\r\n1. Being a permanent employee the user should be able to apply a leave.\r\n\r\nScreen shot',	'2013-02-22 11:57:12'),
