(2597,	951,	'Issue',	11,	'This is NOT a bug from our end. This is a known issue with Twitter API. The script code dynamically generated by Twitter API for user authentication has a bug and it does fails in IE 9.0. This was agreed by the development team of Twitter and they are in process of fixing it by patch. Once the patch is released, it will automatically start working in IE 9.0 as well without making any modifications to our website code. As of now, they support Chrome, Firefox and IE 10.0\r\n\r\nPlease refer to the Twitter development forum discussion on the same topic. \r\nURL: https://dev.twitter.com/discussions/15750#comment-form\r\n\r\nBased on the above clarification, please close this bug.\r\nChanging the status from New to Resolved.\r\n\r\n',	'2013-03-14 17:22:20'),
