INSERT INTO `wiki_content_versions` (`id`, `wiki_content_id`, `page_id`, `author_id`, `data`, `compression`, `comments`, `updated_on`, `version`) VALUES
(1,	1,	1,	1,	'h1. Wiki\r\n\r\nProject Wiki',	'',	'',	'2012-08-13 19:49:05',	1),
(2,	2,	2,	1,	'*Gene Calculator*\r\n\r\nThe project is built using extjs framework. It has a huge list of JSON files which act as a local data store for the application. When the application is loaded the it loads all the files into the clients memory thus providing faster results and swift computation.',	'',	'',	'2012-08-14 00:12:36',	1),
(3,	3,	3,	1,	'h1. Wiki',	'',	'',	'2013-01-21 19:30:17',	1),
(4,	3,	3,	4,	'1. ADD EMail Template',	'',	'',	'2013-03-18 19:46:12',	2),
(5,	3,	3,	4,	'1. ADD EMail Template for each mail\r\n2. Create global config\r\n3. Public profile page for all users with limited information\r\n4. When we delete file record should be deleted\r\n5. Infinite scroll for dashboard,news,events',	'',	'',	'2013-03-18 19:47:40',	3);
INSERT INTO `wiki_contents` (`id`, `page_id`, `author_id`, `text`, `comments`, `updated_on`, `version`) VALUES
(1,	1,	1,	'h1. Wiki\r\n\r\nProject Wiki',	'',	'2012-08-13 19:49:05',	1),
(2,	2,	1,	'*Gene Calculator*\r\n\r\nThe project is built using extjs framework. It has a huge list of JSON files which act as a local data store for the application. When the application is loaded the it loads all the files into the clients memory thus providing faster results and swift computation.',	'',	'2012-08-14 00:12:36',	1),
(3,	3,	4,	'1. ADD EMail Template for each mail\r\n2. Create global config\r\n3. Public profile page for all users with limited information\r\n4. When we delete file record should be deleted\r\n5. Infinite scroll for dashboard,news,events',	'',	'2013-03-18 19:47:40',	3);
